import React from "react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from "@mui/material";

// Sample data for profiles
const profilesData = [
  {
    id: 1,
    name: "John Doe",
    position: "Software Engineer",
    pastProjects: ["Project A", "Project B", "Project C"],
    expertiseYears: 5,
    technicalSkills: ["JavaScript", "React", "Node.js", "MongoDB"],
  },
  {
    id: 2,
    name: "Jane Smith",
    position: "Data Scientist",
    pastProjects: ["Data Project X", "Data Project Y"],
    expertiseYears: 7,
    technicalSkills: ["Python", "Machine Learning", "Data Visualization"],
  },
  // Add more profiles as needed
];

function ProfilePage() {
  return (
    <div>
      <h1>Profiles</h1>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Position</TableCell>
              <TableCell>Past Projects</TableCell>
              <TableCell>Years of Expertise</TableCell>
              <TableCell>Technical Skills</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {profilesData.map((profile) => (
              <TableRow key={profile.id}>
                <TableCell>{profile.name}</TableCell>
                <TableCell>{profile.position}</TableCell>
                <TableCell>{profile.pastProjects.join(", ")}</TableCell>
                <TableCell>{profile.expertiseYears}</TableCell>
                <TableCell>{profile.technicalSkills.join(", ")}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default ProfilePage;
